import React from "react";
import Cservice from "./Cservice";
import "./Service.css";

const Service = () => {
  return (
    <>
      <section className="service" id="service">
        <h1 className="heading">
          <span> my </span> service{" "}
        </h1>
      </section>
      <Cservice />
    </>
  );
};

export default Service;
